import * as React from "react";
import { Router, Route, BrowserRouter } from "react-router-dom";
import Landing from "./pages/Landing";

function App() {
  return (
    <BrowserRouter>
      <Route index path="/" element={<Landing />} />
    </BrowserRouter>
  );
}

export default App;
